const data = require("../current.json");
const { writeFileSync } = require("fs");
const { vlc } = data;

const puppeteer = require("puppeteer");

(async () => {
  const browser = await puppeteer.launch({
    headless: false,
  });

  const tab = (await browser.pages())[0];
  await tab.goto("https://get.videolan.org/vlc/last/win64/");

  await tab.waitForSelector("body > pre > a:nth-child(1)");
  const anchors = await tab.$$("body > pre > a");

  let selected = "";

  for (let i = 0; i < anchors.length; i++) {
    const anchor = anchors[i];
    const href = await anchor.evaluate((anchor) => anchor.href);
    if (href.endsWith(".msi")) {
      selected = href;
      break;
    }
  }

  if (vlc != selected) {
    console.log("ðŸš€ New Update Available!");

    const newData = {
      ...data,
      vlc: selected,
    };

    const octokit = await import("octokit");
    const { Octokit } = octokit;

    const client = new Octokit({
      auth: process.env.GH_TOKEN,
    });

    const vlcData = {
      appDisplayName: "VLC Media Player",
      appId: "nmCvSrMD3BMR9E2V0Opl6edlfU6Q3S6",
      appShortcutName: "",
      authorId: "1",
      description: `VLC media player is a free, open-source, cross-platform multimedia player that can play most media files, including DVDs, audio CDs, and VCDs. It can also play most formats without conversion and supports advanced subtitles, multi-track audio, and playback speed control. VLC also allows users to synchronize files with Dropbox, GDrive, OneDrive, and other services.
Redistributed by AHQ Store (ahqsecret@gmail.com)`,
      displayImages: [],
      downloadUrls: (() => {
        const map = new Map();

        map.set(1, {
          installerType: "WindowsInstallerMsi",
          url: vlc,
        });
        return map;
      })(),
      icon: "",
      install: {
        installType: "Computer",
        win32: {
          assetId: 1,
        },
      },
      repo: {
        author: "ahqstore",
        repo: "redistributed_apps",
      },
      site: "https://www.videolan.org/",
      source: "VideoLAN",
      version: vlc,
    };

    const str = JSON.stringify(vlcData, null, 2);
    const val = [];
    new Uint8Array(Buffer.from(str)).forEach((x) => val.push(x));

    const dat = JSON.stringify(val);

    const release = await client.rest.repos.createRelease({
      owner: "ahqstore",
      repo: "redistributed_apps",
      tag_name: `vlc_${Date.now()}`,
      name: "VLC new version",
    });
    const {
      data: { browser_download_url },
    } = await client.rest.repos.uploadReleaseAsset({
      owner: "ahqstore",
      repo: "redistributed_apps",
      release_id: release.data.id,
      name: "vlc.txt",
      data: dat,
    });

    await client.rest.issues.createComment({
      owner: "ahqstore",
      repo: "apps",
      issue_number: 3,
      body: `/store set ${browser_download_url}`,
    });
    writeFileSync("./current.json", JSON.stringify(newData, null, 2));
  }
  await browser.close();
  process.exit(0);
})();
